import React from 'react';

const NavBar = () => {
  return (
    <nav className={app.nav}>
    <Logo />
    <ul className={app['nav-row']}>
      <li className="btn">
        <a href="#">Download</a>
      </li>
      <li className="btn">
        <a href="#">Sign In</a>
      </li>
      <li className="btn btn-translucid">
        <a href="#">Sign Up</a>
      </li>
    </ul>
  </nav>
  )
}

export default NavBar;
